import React from 'react';

const About = () => {
    return (
        <div>
            <h1>About Us</h1>
            <p>Welcome to our application! We are dedicated to providing the best services to our customers.</p>
            <h2>Our Mission</h2>
            <p>Our mission is to deliver high-quality products and services that meet the needs of our clients.</p>
            <h2>Our Values</h2>
            <ul>
                <li>Integrity</li>
                <li>Innovation</li>
                <li>Customer Satisfaction</li>
            </ul>
        </div>
    );
};

export default About;
